import {
    container as style_container
} from './index.module.css';

const Welcome = ({
    content,
    title
}) => {
    return <div
        className={style_container}
    >
        <span>
            {title}
        </span>
        <p>
            {content}
        </p>
    </div>
};
export default Welcome;
